import React from 'react';
import { HomeBody, ActionContainer } from './styles';


const Home = () => {
  return (
    <HomeBody>
     <ActionContainer>
         <div>Sign Up</div>
        <div>Login</div>
     </ActionContainer>
    </HomeBody>
  );
}

export default Home;
